import React, { useState, useEffect } from 'react';

const Dropdown = ({ label, isOpen, toggleOpen, children }) => (
  <div className={`dropdown ${isOpen ? 'open' : ''}`}>
    <h3 onClick={toggleOpen}>
      <span>{label}</span>
    </h3>
    {isOpen && children}
  </div>
);

const TransactionItem = ({ transaction }) => {
  const [isOpen, setIsOpen] = useState(false);

  const formatDateTime = (timestamp) => {
    const date = new Date(parseInt(timestamp));
    return `${date.toLocaleDateString()} ${date.toLocaleTimeString()}`;
  };

  const renderTransactionDetails = () => {
    const [location, timestamp, type, ...rest] = transaction.split('_');
    const dateTime = formatDateTime(timestamp);
    const [date, time] = dateTime.split(' ');

    if (type === 'send' || type === 'receive') {
      const [targetId, amount] = rest;
      return (
        <>
          <p>Money transfer</p>
          <p>Transaction Date: {date}</p>
          <p>Time of Transaction: {time}</p>
          <p>Payment Amount: ${amount}</p>
          <p>Sender: {type === 'send' ? 'This entity' : targetId}</p>
          <p>Receiver: {type === 'receive' ? 'This entity' : targetId}</p>
        </>
      );
    } else if (type === 'billPay') {
      const [business, amount] = rest;
      return (
        <>
          <p>Bill-Pay</p>
          <p>Transaction Date: {date}</p>
          <p>Time of Transaction: {time}</p>
          <p>Payment Amount: ${amount}</p>
          <p>Sender: This entity</p>
          <p>Business: {business}</p>
        </>
      );
    } else if (type === 'buyGiftCard') {
      const [amount] = rest;
      return (
        <>
          <p>Gift Card Purchase</p>
          <p>Transaction Date: {date}</p>
          <p>Time of Transaction: {time}</p>
          <p>Payment Amount: ${amount}</p>
        </>
      );
    }
  };

  return (
    <div className="transaction-item">
      <h4 onClick={() => setIsOpen(!isOpen)}>{transaction.split('_')[2]} Transaction</h4>
      {isOpen && <div className="transaction-details">{renderTransactionDetails()}</div>}
    </div>
  );
};

function EntityDetails({ nodes }) {
  const [entityTypes, setEntityTypes] = useState({});
  const [transactions, setTransactions] = useState([]);
  const [isTransactionInfoOpen, setIsTransactionInfoOpen] = useState(false);
  const [isEntityInfoOpen, setIsEntityInfoOpen] = useState(false);
  const [isAdditionalInfoOpen, setIsAdditionalInfoOpen] = useState(false);
  const [groupStats, setGroupStats] = useState({});

  useEffect(() => {
    const types = {};
    const allTransactions = [];
    let documentCount = 0;
    let transactionCount = 0;

    nodes.forEach(node => {
      if (!types[node.type]) {
        types[node.type] = [];
      }
      types[node.type].push(node.data);

      if (node.type === 'Transfer' || node.type === 'BillPay') {
        allTransactions.push(node.data.info);
        transactionCount++;
      }

      if (node.type === 'Customer' && node.data.info && node.data.info.Transaction) {
        allTransactions.push(node.data.info.Transaction);
      }

      documentCount++;
    });

    setEntityTypes(types);
    setTransactions(allTransactions);
    setGroupStats({
      documentCount,
      transactionCount,
    });
  }, [nodes]);

  return (
    <div className="details-panel">
      <div className="details-header">
        <h2>Details</h2>
      </div>

      <Dropdown
        label="Transaction Info"
        isOpen={isTransactionInfoOpen}
        toggleOpen={() => setIsTransactionInfoOpen(!isTransactionInfoOpen)}
      >
        <div className="nested-content">
          {transactions.map((transaction, index) => (
            <TransactionItem key={index} transaction={transaction} />
          ))}
        </div>
      </Dropdown>

      <Dropdown
        label="Entity Info"
        isOpen={isEntityInfoOpen}
        toggleOpen={() => setIsEntityInfoOpen(!isEntityInfoOpen)}
      >
        <div className="nested-content">
          {Object.entries(entityTypes).map(([type, entities]) => (
            <Dropdown
              key={type}
              label={`${type} (${entities.length})`}
              isOpen={false}
              toggleOpen={() => {}}
            >
              <ul>
                {entities.map((entity, index) => (
                  <li key={index}>{entity.displayName || entity.id}</li>
                ))}
              </ul>
            </Dropdown>
          ))}
        </div>
      </Dropdown>

      <Dropdown
        label="Additional Information"
        isOpen={isAdditionalInfoOpen}
        toggleOpen={() => setIsAdditionalInfoOpen(!isAdditionalInfoOpen)}
      >
        <div className="nested-content">
          <div className="group-stats">
            <p>Document Count: {groupStats.documentCount}</p>
            <p>Transaction Count: {groupStats.transactionCount}</p>
          </div>
        </div>
      </Dropdown>
    </div>
  );
}

export default EntityDetails;
